import { useEffect, useState } from "react";
import "./App.css";

function App() {
  const [data, changeData] = useState("");
  const [location, changeLocation] = useState("");

  const getData = async () => {
    const info = await fetch(
      "http://api.weatherapi.com/v1/current.json?key=77f552816a9043c686941503221012&q=London"
    );
    const response = await info.json();
    changeData(response.current);
  };

  useEffect(() => {
    getData();
  }, []);

  return (
    <div>
      <p>Temperature (F) {data.temp_f}</p>
    </div>
  );
}

export default App;
